import React from 'react';

function Register() {
  return (
    <div className='row align-items-center'>
      <div className='col-lg-7 py-3 py-md-5'>
        <h1 className='display-2'>Modernization CMS Platform</h1>
      </div>
    </div>
  );
}

export default Register;
